import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import "./reset.css";
import { BrowserRouter,Routes,Route} from "react-router-dom";


ReactDOM.render(

  <React.StrictMode>
    <BrowserRouter>
      <Routes>

          <Route path="/" element={<App/>}/>

      </Routes>

    </BrowserRouter>
  </React.StrictMode>,

  document.getElementById('root')
);
